    protected void Page_Load(object sender, EventArgs e)
    {
        PagePermissions.EnforcePermissions_RequireAll(Session, Response, true, false, false, false, false, true);

        if (!IsPostBack)
            SetupGUI();
    }

    protected void SetupGUI()
    {
        DataTable allFields = DBBase.GetGenericDataTable_WithWhereOrderClause(null, "Field", "has_offerings = 1 AND field_id != 0", "descr", "field_id", "descr");
        Hashtable existingFieldsHash = new Hashtable();
        lblCurrentFields.Text = string.Empty;
        foreach (DataRow row in allFields.Rows)
        {
            lblCurrentFields.Text += (lblCurrentFields.Text.Length == 0 ? "" : "<br />") + "• " + row["descr"].ToString();
            existingFieldsHash[row["descr"].ToString().ToLower()] = 1;
        }


        ArrayList fields = new ArrayList();
        foreach (string field in AllFields)
            if (existingFieldsHash[field.ToLower()] == null)
                fields.Add(field);
        fields.Sort();

        ddlField1.Items.Clear();
        ddlField1.Items.Add(new ListItem("<SELECT>", "SELECT"));
        foreach (string f in fields)
            ddlField1.Items.Add(new ListItem(f, f));
    }

    protected string[] AllFields
    {
        get
        {
            return new string[] {
                "Audiologist",
                "Chiropractor",
                "Diabetes Educator",
                "Dietitian",
                "Exercise Physiologist",
                "General Practitioner",
                "Mental Health Worker",
                "Neuro Therapist",
                "Occupational Therapist",
                "Osteopath",
                "Physiotherapist",
                "Podiatrist",
                "Psychologist",
                "Psychologists",
                "Social Worker",
                "Speech Pathologist"
            };
        }
    }




    protected void btnSubmit_Click(object sender, EventArgs e)
    {
        string errMsg = string.Empty;

        txtField1.Text = Utilities.FormatName(txtField1.Text.Trim());

        if (ddlField1.SelectedValue == "SELECT" && txtField1.Text == string.Empty)
            errMsg += (errMsg.Length == 0 ? "" : "<br />") + "Field has not been selected";

        if (errMsg.Length > 0)
        {
            SetErrorMessage(errMsg);
            return; 
        }



        string curDbName = Session["DB"].ToString();

        try
        {

            ArrayList fieldsToAdd = new ArrayList();
            if (ddlField1.SelectedValue != "SELECT")
                fieldsToAdd.Add(ddlField1.SelectedValue);
            if (txtField1.Text != string.Empty)
                fieldsToAdd.Add(txtField1.Text);

            foreach (string field in fieldsToAdd)
            {
                bool   alreadyExists = false;
                string sql_update;
                int    newFieldID;

                if (field == "General Practitioner")
                {
                    alreadyExists = Convert.ToBoolean(DBBase.ExecuteSingleResult("SELECT (CASE WHEN (SELECT COUNT(*) FROM Field WHERE field_id = 1 AND descr = 'General Practitioner') = 0 THEN 0 ELSE 1 END)"));
                    if (!alreadyExists)
                    {
                        sql_update = @" IF (SELECT COUNT(*) FROM Field WHERE field_id = 1 AND descr = 'General Practitioner') = 0
                                        BEGIN
	                                        SET IDENTITY_INSERT Field ON;
	                                        INSERT Field
	                                          (field_id, descr, has_offerings)
	                                        VALUES
	                                          (1,'General Practitioner', 1);
	                                        SET IDENTITY_INSERT Field OFF;
                                        END" + Environment.NewLine;

                        DBBase.ExecuteNonResult(sql_update);
                    }
                    newFieldID = 1;
                }
                else
                {
                    sql_update = @"INSERT Field (descr, has_offerings) VALUES ('" + field.Replace("'", "''") + @"' , 1);SELECT SCOPE_IDENTITY();" + Environment.NewLine;
                    newFieldID = Convert.ToInt32(DBBase.ExecuteSingleResult(sql_update));
                }


                if (!alreadyExists)
                {
                    string sql_update2 = string.Empty;
                    LetterTreatmentTemplate[] letterTreatmentTemplates = LetterTreatmentTemplateDB.GetAll();
                    Hashtable siteIDsSeenHash = new Hashtable();
                    foreach (LetterTreatmentTemplate ltt in letterTreatmentTemplates)
                    {
                        if (siteIDsSeenHash[ltt.Site.SiteID] == null)
                        {
                            siteIDsSeenHash[ltt.Site.SiteID] = 1;
                            sql_update2 = @"INSERT INTO LetterTreatmentTemplate values (" + newFieldID + ",1,2,3,2," + ltt.Site.SiteID + ",2);" + Environment.NewLine;
                            DBBase.ExecuteNonResult(sql_update2);

                        }
                    }
                }
            }



            DBBase.ExecuteNonResult(InsertOfferingsSQL);


            SetErrorMessage("Done.");
            SetupGUI();

        }
        catch (CustomMessageException ex)
        {
            SetErrorMessage(ex.Message);
        }
        catch (Exception ex)
        {
            SetErrorMessage("", ex.ToString());
        }

    }

